Begin by installing via your favourite package manager 

npm install @oui-ui/checkbox  

Use in your HTML, JSX, or whatever: 

&#x3C;!DOCTYPE html> 
&#x3C; html >  
    &#x3C; head >  
        &#x3C; title >  Quick Start&#x3C;/ title >  
        &#x3C; meta  charset = " UTF-8"   />  
    &#x3C;/ head >  

    &#x3C; body >  
        &#x3C;!-- Use web components in your HTML like regular built-in elements. --> 
        &#x3C; oui-checkbox >  
            &#x3C; p  slot = " label"  >  Hey there&#x3C;/ p >  
            &#x3C; div  slot = " indicator"   class = " indicator"  >  &#x3C;/ div >  
        &#x3C;/ oui-checkbox >  

        &#x3C;!-- oui-ui web components use standard JavaScript modules. --> 
        &#x3C; script  type = " module"  >  
            import  '@oui-ui/checkbox' 
          &#x3C;/ script >  
    &#x3C;/ body >  
&#x3C;/ html >  


Add some custom css to your checkbox 

oui-checkbox::part ( indicator)   { 
    display :  flex; 
    align-items :  center; 
    justify-content :  center; 
    border :  1 px  solid red; 
    border-radius :  2 px ; 
    height :  24 px ; 
    width :  24 px ; 
    margin-right :  8 px ; 
    position :  relative; 
} 

oui-checkbox[ checked ]   .indicator   { 
    background :  red; 
    width :  100 % ; 
    height :  100 % ; 
} 

oui-checkbox[ indeterminate = 'true' ]   .indicator   { 
    background :  red; 
    border-radius :  2 px ; 
    height :  30 % ; 
    width :  65 % ; 
} 





